public double fillRatio() {
  if (nodeCount > 1) {
    // Count the last node as completely full since it can't be compacted
    return (size + (Node.NODE_SIZE - root.getRightMostNode().size))
           / (double) (nodeCount * Node.NODE_SIZE);
  }
  return 1.0;
}
